INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (1, 0, 0.5, 1, 16612041, "まったくもう……\nみんなして絵の具まみれじゃない。\nって、あら？　この赤いのは……", 0, 10, 105111, 16612, 11);
