INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (1, 0, 0.5, 1, 18812031, "むっ、ちょっと待て。\nこの絵のテーマは、繰り返される\n運命の闘争が織りなす限りなき\nウロボロスの循環ではないのか！？", 0, 10, 100911, 18812, 11);
